																		October 25-27, 2019 Konya - TURKEY















































































																		Dear colleagues,

























































																		International Conference on Engineering Technologies will be held on October 25 - 27, 2019, at Selcuk University in Konya, Turkey.

																		The ICENTE19 conference is designed to bring together leading international and interdisciplinary research communities, developers, and users of advanced technologies and to discuss theoretical and practical issues in all the field of technologies.






































																		Topic






																		The main objective of ICENTE&#39;19 is to present the latest research and results of scientists related to Computer Sciences, Electrical & Electronics, Energy Technologies, Mechaninal Engineering, Manufacturing Technologies, Mechatronics and Biomedical Technologies.

























































																		Selected Papers













































																		The contributions will be evaluated by the Scientific Committee. The papers approved by the scientific committee will be presented. The selected papers presented in the conference that match with the topics of the journals will be published in the journal of Seluk-Teknik
																		We hope this conference will be of your interest.







































































